import React from 'react';
import { Container } from './styles';

function SignIn() {

  return (
    <>
      <Container >
        <h1>SignIn</h1>

        <form>
          <input type="email" placeholder="Email"/>
          <input type="password" placeholder="Password"/>
        </form>


      </Container>
    </>
  );
}

export default SignIn;
